import React from "react";
import { Fragment } from "react/cjs/react.production.min";
import './icons.css';

const Icons=()=>{
    return(
        <Fragment>
            <div className="icons">
            <span className="icon_1"><a href="https://www.linkedin.com/in/priyansh-gupta-5039241a0" className="link"><ion-icon  name="logo-linkedin"></ion-icon></a></span>
            <span className="icon_2"><a className="link"><ion-icon  name="logo-github"></ion-icon></a></span>
            <span className="icon_3"><a className="link"><ion-icon  name="logo-instagram"></ion-icon></a></span>
            </div>
        </Fragment>
    )
}

export default Icons;
